  <h3 class="Heading_20_3"><a id="a__Introduction" name=
  "a__Introduction"></a>Introduction</h3>

  <p class="Standard">The “SIL Ethiopic” keyboard was developed to input
  Ethiopic Fidel scripts. You can use this keyboard with any Ethiopic Unicode
  font unless you need to use the newer Unicode 6.0+ Ethiopic codepoints (for
  Basketo, Gumuz and Gamo-Gofa-Dawro) or the two Private Use Area (PUA)
  characters of this keyboard (“<span class="Output"></span>” and
  “<span class="Output"></span>”). The <a href=
  "http://scripts.sil.org/AbyssinicaSIL" class="Internet_20_link">Abyssinica
  SIL</a> font (version 1.5+) is recommended if you need to use these newer
  Unicode 6.0+ or PUA characters.</p>

  <table border="0" cellspacing="0" cellpadding="0" class="Table6">
    <colgroup>
      <col width="730">
    </colgroup>

    <tr class="Table61">
      <td style="text-align:left;width:16.695cm;" class="Table6_A1">
        <h5 class="Heading_20_5"><a id=
        "a__Note_on_Legacy_SIL_Ethiopic_Keyboard_Compatibility" name=
        "a__Note_on_Legacy_SIL_Ethiopic_Keyboard_Compatibility"></a>Note on
        Legacy SIL Ethiopic Keyboard Compatibility</h5>

        <p class="Standard">The original “SIL Ethiopic” used alternative
        capital letter keys to produce less frequently used characters. These
        alternative capital letter keys are still able to be used, but an
        alternative method for creating these less frequently used characters
        has been added.</p>

        <p class="Standard">The preferred method for creating these less
        frequently used characters is by using the “<span class=
        "Keyboard">[</span>” key after the letter key to produce the desired
        character.</p>

        <p class="Standard">For example, to create “<span class=
        "Output">ሥ</span>” the chart shows “<span class=
        "Keyboard">s&nbsp;[&nbsp;or&nbsp;J</span>”. To produce this character
        using the preferred method, first press the “<span class=
        "Keyboard">s</span>” key, and then press the “<span class=
        "Keyboard">[</span>” key. Alternatively, a capital “<span class=
        "Keyboard">J</span>” can be typed to produce the “<span class=
        "Output">ሥ</span>” character.</p>

        <p class="Standard">As another example, to create “<span class=
        "Output">ፅ</span>” the chart shows “<span class=
        "Keyboard">T&nbsp;[&nbsp;or Y</span>”. To produce this character using
        the preferred method, first type a capital “<span class=
        "Keyboard">T</span>”, and then press the “<span class=
        "Keyboard">[</span>” key. Alternatively, a capital “<span class=
        "Keyboard">Y</span>” can be typed to produce the “<span class=
        "Output">ፅ</span>” character.</p>
      </td>
    </tr>
  </table>

  <p class="Standard">&nbsp;</p>

  <p class="Standard">&nbsp;</p>

