    <tr class="Table72">
      <td style="text-align:left;width:17.611cm;" class="Table7_A2">
        <p class="Standard">First type the keystrokes from the leftmost column,
        followed by the keystrokes at the top of the column. For example, to
        produce “<span class="Output">ሀ</span>” first press the “<span class=
        "Keyboard">h</span>” key, and then press the “<span class=
        "Keyboard">v</span>” key. To produce “<span class="Output">ሄ</span>”
        first press the “<span class="Keyboard">h</span>” key, and then press
        the “<span class="Keyboard">e</span>” key. The default form is the 6th
        form (you do not need to type the “<span class="Keyboard">-</span>”
        key).</p>
      </td>
    </tr>
  </table>

